vector<string> sortPeople(vector<string>& names, vector<int>& v) {
    multiset<pair<ll,string>> ms;
    for(ll i = 0;i<names.size();++i){
        ms.insert({v[i],names[i]});
    }

    vector<string> ans;
    while(!ms.empty()){
        auto p = *ms.rbegin();
        ms.erase(ms.find(p));
        ans.push_back(p.second);
    }
    return ans;
} 

int longestSubarray(vector<int>& v) {
    ll ans = *max_element(v.begin(),v.end());
    ll cntr = 0,mx = 0;
    for(ll i = 0;i<v.size();++i){
        if(v[i] == ans){
            ++cntr;
        }else{
            cntr = 0;
        }
        mx = max(mx,cntr);
    }
    return mx;
}

