// Disjoint Union Find!!!
vector<ll> vis,v;
ll ele = 0,ans = 0,par = 0;
multiset<pair<ll,ll>> ms;
void dfs(ll i){
    vis[i] = 1;
    if(v[i] > ele){
        return;
    }

    for(auto it:adj[i]){
        if(!vis[it]){
            dfs(it);
        }
    }

    if(v[i] == ele){ms.insert({par,i});}
    return;
}

int numberOfGoodPaths(vector<int>& val, vector<vector<int>>& edges) {
    ll n = val.size();
    for(ll i = 0;i<n;++i){v.push_back(val[i]);}
    ms.clear();
    for(auto it:edges){adj[it[0]].push_back(it[1]);adj[it[1]].push_back(it[0]);}

    for(ll i = 0;i<n-1;++i){
        vis.assign(n+1,0);
        ele = val[i];
        par = i;
        dfs(i);
    }

    for(auto &it:ms){
        if(ms.find({it.second,it.first}) != ms.end()){
            ms.erase(ms.find({it.second,it.first}));
        }
    }
    ans = ms.size();
    return ans;
}

